import React,{Component} from 'react';
import 'tachyons';
import './Nav.scss';
import { useLocation } from 'react-router-dom';
import { HashLink as Link } from 'react-router-hash-link';
import  {ReactComponent as LogoDebugged} from './debuggedlogo.svg';

const Nav =({onRouteChange,route})=>
{
  const location = useLocation();
    return (
      <div>
      <div className="topnav">
      <div className="mt0">

      </div>
       &nbsp;
       <div className="navhead" style={{fontFamily: 'Yusei Magic'}}>
            <Link to='/' ><span className={`white nav  ul f4 ${location.pathname==='/'?'active1':'left ul'} `} >Home</span></Link>
            <Link to='/#about'><span className={`white nav  ul f4 ${location.hash==='#about'?'active1':'left ul'} `}>About Us</span></Link>
            <Link to='/work'><span className={`white nav  ul f4 ${location.pathname==='/work'?'active1':'left ul'} `}> Our Work</span></Link>
            <Link to='/contact'><span className={`white nav  ul f4 ${location.pathname==='/contact'?'active1':'left ul'} `}>Contact Us</span></Link>
       </div>
     </div>
     </div>

    );
  }

export default Nav;
